  addItem() {
    console.log("Added item.");
  }
  render() {
    return (
      <div>
        <div>This is the Todo component: {this.props.testprop}</div>
        <input type="text" placeholder="Type todo item..." />
        <button onClick={() => this.addItem()}>Add</button>
      </div>
    );
  }
}

export default Todo;
